import React from "react";
import {
  Link
} from "react-router-dom";
import '../App.css';



function Home() {
  return (
    <div className="body">
      <div className="Container">
        <div className="card">
          <div className="contentbox">
            <h3>Stream</h3>
            <div className="text">
              ceci est le stream
          </div>
            <Link className="go" to="/Stream">Go to stream</Link>
          </div>
        </div >
      </div>
      <Link to="/Stats">Stats</Link>

    </div >
  );
}

export default Home;
